import { useRouter } from 'next/router'

export default () => {

  const router = useRouter()

  return (
    <>
      <h1 className="com-title-section-xl hlp-marginBottom-40">Slug Buscado</h1>
      <p>Slug: {router.query.slug}</p>
    </>
  )
}
